def ispal(n): s = str(n); return s == s[::-1]
def aupton(terms):
    alst, seen = [1, 2], {1, 2}
    for n in range(2, terms):
        an, partial_sum = 1, int(str(alst[-2]) + str(alst[-1]))
        while an in seen or not ispal(partial_sum + an): an += 1
        alst.append(an); seen.add(an)
    return alst
